import React from 'react'
import App from './App.js'

class Navbar extends React.Component{
    render() {
        return(
            <div>
                <ul id="nav">
                    <li><a href = "#">Home</a></li>
                    <li><a href = "#">History</a></li>
                    <li><a href = "#">Prediction</a></li>
                    <li><a href = "#">Prevention</a></li>
                    <li><a href = "#">Community</a></li>
                </ul>
            </div>
        );
    }
}
